%%%% On completion to exit the program, not matlab% Clean up everything% Author: Shelby Luttrell% Created: March 15, 2017%% This file is included in assignment 1. The% purpose of this file is to clear the graphic% window, quit the assignment 1 application% and exit the matlab environment. When user% click the 'Exit' button in the menus, this script cleanup will be executed.diary off%viewport windowcla     % clear all drawings in the figureclf     % clear figure decorationsclose   % close the current windowclose   all % close the all open figure windows% commandlineclc     % clear all commandsclear all   % clear variable command window% to terminate matlab%quit   % exit the matlab%exit   % exit the matlab